import styled from 'styled-components'

export const HeaderHeader = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 30px;
`

export const HeaderHeaderLogo = styled.h1`
  font-size: 36px;
  letter-spacing: 3px;
  color: #d91818;
  width: 20%;
`
